import axios from "axios";
import React, { useEffect } from "react";
import { urlTripDetail } from "../../components/url/urls";

export default function Dashboard(){
  useEffect(() => {
    const token = localStorage.getItem('token')
    axios.get(urlTripDetail)
    headers: {
      auth: token
    }
  }, [])

  return (
    <div>
      <h1>Dashboard</h1>
    </div>
  );
}
